tables.table_schema:
CREATE TABLE Survey_Data (
    survey_id INT PRIMARY KEY,
    question TEXT,
    answer TEXT,
    respondent_id INT
);

CREATE TABLE Respondents (
    respondent_id INT PRIMARY KEY,
    name TEXT,
    age INT,
    gender TEXT
);

CREATE TABLE survey_data (
  survey_id INT,
  question VARCHAR(255),
  response TEXT,
  respondent_id INT
);

CREATE TABLE survey_questions (
  question_id INT,
  question_text TEXT,
  question_type VARCHAR(50),
  survey_id INT
);
